import React from "react";
import Data from "../Components/Data";

export default function Home() {
  return (
    <div>
      <Data data={localStorage} />
      <nav id="bottomNav">
        <div style={{ flex: 1 }}>
          <div>USER</div>
        </div>
        <input type="text" />
        <div style={{ flex: 1 }}>
          <div>BUTTONS</div>
        </div>
      </nav>
    </div>
  );
}
